import React from "react";
import styled from "styled-components";

const Box = styled.div`
  width: 523.8px;
  height: 60px;
  padding: 1rem;
  border: 1px solid gray;
  border-radius: 5px;
  background-color: #fff;
  margin: .6rem auto;
`;

const Todo = () => {
  return <Box>
      <p>New Task To do</p>
     
  </Box>;
};

export default Todo;
